import React from 'react';


const Footer = (props) => {
  return (
  <div>
  <p>Made with <span style={{ color: '#e25555'}}>&#9829;</span> by ${props.name}</p>
  </div>
);
};

const element = <Footer name="Ben" />;

export default Footer;
